import modal
import os
import base64
import pandas as pd
import joblib

# --- Configuration ---
app = modal.App(name="anemia-cbc-predictor")

# Add scikit-learn for model prediction, and fastapi for web endpoint
image = modal.Image.debian_slim().pip_install(
    "pandas",
    "fastapi",
    "scikit-learn"
)

# --- Base64 Encoded Model Strings ---
# vvv PASTE YOUR STRINGS HERE vvv
ENCODED_MODEL_STRING = ""

ENCODED_COLUMNS_STRING = "gASVMAAAAAAAAABdlCiMCkhlbW9nbG9iaW6UjANNQ0iUjARNQ0hDlIwDTUNWlIwIR2VuZGVyXzGUZS4="

# ^^^ PASTE YOUR STRINGS HERE ^^^


# --- Model Class Definition ---
@app.cls(image=image)
class AnemiaPredictor:
    @modal.enter()
    def load_model(self):
        """Decode Base64 strings back into files and load the model."""
        self.model_path = "/tmp/anemia_model.joblib"
        self.columns_path = "/tmp/model_feature_columns.joblib"

        try:
            with open(self.model_path, "wb") as f:
                f.write(base64.b64decode(ENCODED_MODEL_STRING))
            with open(self.columns_path, "wb") as f:
                f.write(base64.b64decode(ENCODED_COLUMNS_STRING))
        except Exception as e:
            print(f"Error decoding Base64 strings: {e}. Check if strings were pasted correctly.")
            return

        print("Loading model from temporary file...")
        self.model = joblib.load(self.model_path)
        self.feature_columns = joblib.load(self.columns_path)
        print("Model loading complete.")

    @modal.fastapi_endpoint(method="POST")
    def predict(self, user_input: dict):
        """API endpoint function to predict anemia based on user input JSON."""
        
        # --- Preprocessing new input data ---
        input_df = pd.DataFrame([user_input])
        processed_input_df = pd.get_dummies(input_df, columns=['Gender'])
        processed_input_df = processed_input_df.reindex(columns=self.feature_columns, fill_value=0)

        # --- Prediction ---
        prediction_value = self.model.predict(processed_input_df)[0]
        probability_scores = self.model.predict_proba(processed_input_df)[0]

        result = {
            "prediction_class": int(prediction_value),
            "label": "Anemic" if prediction_value == 1 else "Non-Anemic",
            "confidence_scores": {
                "non_anemic_probability": round(probability_scores[0], 4),
                "anemic_probability": round(probability_scores[1], 4)
            }
        }
        return result